import {connect} from "react-redux";
import {Field, reduxForm} from "redux-form";
import {required} from "../../Utils/Validators/validator";
import s from "./CheckoutaStyle/Checkouta.module.css";


const ChekoutForm = (props) => {


    return (

        <form onSubmit={props.handleSubmit} className={s.form_login}>
            <div>
                <Field className={s.inputform} placeholder={"Login"} name={"email"}
                       validate={[required]}/>
            </div>

            <div className={s.password}>
                <Field className={s.inputform_password} placeholder={"Password"}
                       type={props.watchstatus}
                       name={"password"}
                       validate={[required]}/>



            </div>

            {props.error &&
            <div className={s.no_login_error}> {props.error}</div>


            }
            <div className={s.check}>

                <Field type={"checkbox"} name={"rememberme"} className={s.checkbox}/>
                <span>remember me</span>
            </div>


            <div>
                <button className={s.button}>Login</button>
            </div>
        </form>
    )
}


const ReduxChekoutForm = reduxForm({
    form: 'login'

})
(ChekoutForm)


const Checkout = (props) => {


    return (
        <div className={s.content}>
            <div className={s.login_block}>
                <h1>Login</h1>
                <ReduxChekoutForm />
            </div>

        </div>
    )

}


const mapStateToProps = (state) => ({

})
export default connect(mapStateToProps, {})(Checkout)
